<script setup>
import QRCodeVue3 from "qrcode-vue3";
import {nextTick, onMounted, ref} from "vue";

const qrCode = ref(); // Reactive variable to store the QR code
const isVisible = ref(false); // Reactive variable to control the visibility of the QR code

defineProps({
    title: {
        required: true,
        type: String,
        default: "QR"
    }
})

// Run when the component is mounted
onMounted(() => {
    // Set the visibility of the QR code to true to reduce to load time
    isVisible.value = true;
});


// Function to get the current URL without query parameters
const getCurrentURL = () => {
    // Create a new URL object based on the current window location
    const currentURL = new URL(window.location.href);
    // Remove any query parameters from the URL
    currentURL.search = '';
    // Return the cleaned URL
    return currentURL.href;
};
const downloadAble = ref(false);
// Function to trigger a click event on a download button
const onDownload = () => {
    downloadAble.value = true;
    nextTick(() => {
        const clickButton = document.querySelector('.dbtn');
        clickButton.click();
        nextTick(() => {
            downloadAble.value = false;
        });
    });
};

// Expose the 'onDownload' function to the parent component
defineExpose({
    onDownload,
});

// https://github.com/scholtz/qrcode-vue3 - styling and usage
</script>

<template>
    <transition>
        <div style="width: 85px; height: 85px;" v-if="isVisible">
            <QRCodeVue3
                :image="'data:image/png;base64,'"
                ref="qrCode"
                :width="300"
                :height="300"
                :margin="10"
                :value="getCurrentURL()"
                :qrOptions="{ typeNumber: 0, mode: 'Byte', errorCorrectionLevel: 'H' }"
                :imageOptions="{ hideBackgroundDots: true, imageSize: 0.4, margin: 10 }"
                :dotsOptions="{
        type: 'square',
        color: 'green',
        gradient: {
          type: 'linear',
          rotation: 0,
          colorStops: [
            { offset: 0, color: '#5f91be' },
            { offset: 1, color: 'gray' },
          ],
        },
      }"
                :backgroundOptions="{ color: '#ffffff'}"
                :cornersSquareOptions="{ type: 'square', color: '#25465e' }"
                :cornersDotOptions="{ type: 'square', color: '#25465e' }"
                fileExt="png"
                :download="downloadAble"
                imgclass="img-qr rounded-lg"
                downloadButton="dbtn opacity-0"
                :downloadOptions="{ name: title, extension: 'png' }"
            />
        </div>
    </transition>
</template>
